import React, { Component } from 'react';
// import axios from "axios";
// import * as powerPlant from './data/power-plants.json';

class PowerPlantsData extends Component {

    constructor(props) {
        super(props);
        this.state = {

            items: [],
            isLoaded: true,

        };
    }

    componentDidMount(){
        this.interval = setInterval(() => this.setState({ time: Date.now() + 10 }), 1000);
        this.getFetch();
    }

    componentDidUpdate(){
        // clearInterval(this.interval);
    }

    getFetch(){

        fetch('http://localhost:8081/power-plants')
            .then(res => res.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    items: json,
                })
            });
    }

    render () {

        var { isLoaded, items } = this.state;


        if(!isLoaded){
            return <div>Loading...</div>;
        }
        else
        {   
            return (
                <div>

                    <ul>
                        {items.map(item => (
                            <li>
                                Name: {item.name} | Postal Code: {item.plz} | City: {item.city}
                            </li>
                        ))};
                    </ul>

                </div>
            );
        }



    }
}

export default PowerPlantsData;
